// For IPad Scroll 
 
   function isMobile()
    {
       var index = navigator.appVersion.toLowerCase().indexOf("mobile");       
       return (index > -1);
    }    
     
    function IpadScroller(){
       
        if(isMobile()){
 
            $('.scroll-pane').each(function(index){
                 if ($(this).attr('display')!='hidden')        $(this).jScrollPane();});

            $("a.scroll_ipad",$("#tabs ul li")).click(function() {
	    
	    	var activeTab = $(this).attr("href"); //Find the href attribute value to identify the active tab + content
	    	scrollRefresh(activeTab);
	    
		});
           
        }
        
    }
    
    function scrollRefresh(anchorTag){    	
    	$('#'+anchorTag.substring(1)).jScrollPane();
    }    
    
/* Scholar POPUP */
var player;
$(document).ready(function() {
	//When you click on a link with class of poplight and the href starts with a # 
$('a.poplight').click(function() {
    
    var popID = $(this).attr('rel'); //Get Popup Name
    var popURL = $(this).attr('href'); //Get Popup href to define size

    //Pull Query & Variables from href URL
    var query= popURL.split('?');
    var dim= query[1].split('&');
    var popWidth = dim[0].split('=')[1]; //Gets the first query string value

    //Fade in the Popup and add close button. Image src will start from ../../common/images in offline version as images are stored inside the "common" folder
    $('#' + popID).fadeIn().css({ 'width': Number( popWidth ) }).prepend('<a href="#" class="close"><img src="../../common/images/close.png" class="video_popup_btn_close" title="Close Window" alt="Close" /></a>');

    //Define margin for center alignment (vertical   horizontal) - we add 80px to the height/width to accomodate for the padding  and border width defined in the css
    //var popMargTop = ($('#' + popID).height() + 325 + 80) / 2;
    var popMargTop = (388 + 80) / 2;
    var popMargLeft = ($('#' + popID).width() + 80) / 2;

    //Apply Margin to Popup
    $('#' + popID).css({
        'margin-top' : -popMargTop,
        'margin-left' : -popMargLeft
    });

    //Fade in Background
    $('body').append('<div id="video_popup_fade"></div>'); //Add the fade layer to bottom of the body tag.
    $('#video_popup_fade').css({'filter' : 'alpha(opacity=80)'}).fadeIn(); //Fade in the fade layer - .css({'filter' : 'alpha(opacity=80)'}) is used to fix the IE Bug on fading transparencies 

    return false;
});

//Close Popups and Fade Layer
$('a.close, #video_popup_fade').live('click', function() { //When clicking on the close or fade layer...
    $('#video_popup_fade , .popup_block').fadeOut(function() {
        $('#video_popup_fade, a.close').remove();  //fade them both out
    });
    jwplayer(player).stop();
    return false;
});
});

/* OCW Offline Video Player code */
var stop_marker = 1000000; 

function timeMonitor(obj)
{
    time = obj.position;
    current_position = time;
    if (current_position > stop_marker){
        jwplayer(player).stop();
    }
}

var oldWrapper = null;
var oldCode;

function reset_video_wrapper_markup(theOldWrapper, theOldCode) { 
	document.getElementById(theOldWrapper).innerHTML = theOldCode;
}

function initialize_video_wrapper_markup(theWrapper) {
    // Live version
    if (oldWrapper != null) { reset_video_wrapper_markup(oldWrapper, oldCode); }

	oldWrapper = theWrapper; 
	oldCode = document.getElementById(oldWrapper).innerHTML; 
}


function load_media_chapter(media_url,provider, page_url, image_url, start, stop, captions_file){
    // Live version
    var allow_full_screen = 'true';
    if(provider == 'sound'){
        allow_full_screen = 'false';
    }

    var srtfile='';
    if (captions_file != null && captions_file !=''){
        if (captions_file.substr(0, 1)== "/"){
            srtfile = "http://ocw.mit.edu" + captions_file;
        
        }
        else{
            srtfile = captions_file;
        }
    }

    stop_marker = stop;
    var flashvars = { file: media_url,
                      autostart:'true',
                      'captions.file': srtfile,
                      start: start,
                      duration:stop,
                      provider: provider,
                      image: image_url
                    };

    jwplayer().load(flashvars);
    jwplayer().play(true); 
}

function ocw_embed_media(container_id, media_url, provider, page_url, image_url, captions_file){
    //set jwplayer options for setup function
    var options = set_jwplayer_options(container_id, 'player21', media_url, provider, page_url, image_url, 0, 0, captions_file);
 
    //set the autostart property false to not start the video automatically
    options['autostart'] = 'false';
    
    // set the additional options for vimeo videos
    if (provider == '/jwplayer/vimeoprovider.swf')
    {
        options = set_jwplayer_options_vimeo(options);
    }                       
    
    jwplayer(container_id).setup(options);  
}

function ocw_embed_audio(container_id, media_url, width){
    //set jwplayer options for setup function
    var options = set_jwplayer_options(container_id, 'player21', media_url, null, null, null, 0, 0, null);
    
    // set the height and width of player to show the controlbar only
    options['height'] = 24;
    options['width'] = width;
    
    // set the plugin list to blank to hide sharing and caption plugin
    options['plugins'] = {};
    
    jwplayer(container_id).setup(options);
}

function load_multiple_media_chapter(theWrapper,container_id,thePlayer,media_url,provider, page_url, image_url, start, stop, captions_file){
    initialize_video_wrapper_markup(theWrapper);
  
    //set jwplayer options for setup function
    var options = set_jwplayer_options(container_id, thePlayer, media_url, provider, page_url, image_url, start, stop, captions_file);
     
    //set the autostart property true to start the video automatically
    options['autostart'] = 'true';
    options['duration'] = stop;
    
    jwplayer(container_id).setup(options);   
}

function scholar_video_popup(theWrapper,container_id,thePlayer,media_url,provider, page_url, image_url, start, stop, captions_file){
    // initialize the video container inner html 
    initialize_video_wrapper_markup(theWrapper);
    
    //set jwplayer options for setup function
    var options = set_jwplayer_options(container_id, thePlayer, media_url, provider, page_url, image_url, start, stop, captions_file);
 
    jwplayer(container_id).setup(options);
}

function set_jwplayer_options(container_id, thePlayer, media_url, provider, page_url, image_url, start, stop, captions_file){
    var allow_full_screen = 'true';
    if(provider == 'sound'){
        allow_full_screen = 'false';
    }
    
    var autostart = 'false';
    if (start !=0){
        autostart = 'true';
    }

    var plugin_list = {};
    
    if (provider == '/jwplayer/vimeoprovider.swf')
    {
        //Using jw-player-free components in offline version
        plugin_list['http://ocw.mit.edu/jw-player-free/vimeocomponent.swf'] =   {   'hide_hd_button': true,
                                                            'hide_playbar': true,
                                                            'hide_like_button': true,
                                                            'hide_embed_button': true,                                      
                                                            'hide_share_button': true
                                                        };
        
    }
        
    var srtfile='';
    if (captions_file != null && captions_file !=''){
        if (captions_file.substr(0, 1)== "/"){
            srtfile = "http://ocw.mit.edu" + captions_file;
        }
        else{
            srtfile = captions_file;
        }
        plugin_list['http://ocw5.mit.edu/jw-player-free/captions-2.0h.swf'] = {file: srtfile};
    }
    
    if (stop==0){
     stop=1000000;
    }
    stop_marker = stop; 
    
    var attributes = { id:thePlayer, name:thePlayer };
    
    //Using jw-player-free components in offline version 
    return  {players:   [
                            {type: "flash", src: "http://ocw.mit.edu/jw-player-free/player.swf" },
                            {type: "html5" }
                        ],
            attributes: attributes,
            allowfullscreen: allow_full_screen,
            allowscriptaccess: 'always',
            height: 325,
            width: 530,
            start: start,
            file: media_url,
            autostart: autostart,
            plugins: plugin_list,
            provider: provider,
            image: image_url,
            controlbar: 'bottom',            
            events: {
                    onReady: function() { 
                                            player = document.getElementById(container_id);  
                                            current_position = 0; 
                                        },
                    onTime: function(event){
                                            timeMonitor(event);                                    
                                           }               
                    }                    
    
    };
}

function set_jwplayer_options_vimeo(options){
    
    options['flashvars'] =  {   item:1,
                                screencolor:"0000ff", 
                                dock:true
                            };
    //Using jw-player-free components in offline version        
    options['provider'] = "http://ocw.mit.edu/jw-player-free/vimeoprovider.swf";                              
    
    return options;   
}
